CREATE DATABASE `onlinejudge` COLLATE utf8_vietnamese_ci;

CREATE TABLE `onlinejudge`.`users`
(
    `mssv` VARCHAR(20) NOT NULL,
    `first_name` VARCHAR(50) NOT NULL COLLATE utf8_vietnamese_ci,
    `last_name` VARCHAR(50) NOT NULL COLLATE utf8_vietnamese_ci,
    `password` VARCHAR(100) NOT NULL,
    `hash` VARCHAR(32) NOT NULL,
    `active` BOOL NOT NULL DEFAULT 1,
PRIMARY KEY (`mssv`) 
);












